import React from "react";
import { Link } from "react-router-dom";

const Navbar = props => (
  <div className="navigation">
    <ul>

      <li>About Me</li>
      <li>Languages & Frameworks</li>
      <li>My Projects</li>
      <li>Contact Me</li>
    </ul>
  </div>
);

export default Navbar;
